@ldpsincomplejos La clave del gobierno la tiene ERC. O la disputa entre ERC, JxC y PSC

Si ERC se ponen tibios, teniendo a Junqueras en la carcel, JxC y la CUP suben. Y el tanto se lo apunta el PSC

Si ERC se pone duro, el PSOE se suicida

@BluRadioCo @AlvaroUribeVel Voy a tirarme de un puente con intención recreativa y no suicida.

Esto es otro ejemplo claro de que la conveniencia de las cosas siempre apunta para las élites.

"El fin NO justifica los medios".

